void ProcessInputs(string groupName, (string templateFileName, Dictionary<string, string> templateData)[] inputs)
{
    if (!projectName.Equals($"{groupName}_r") && !projectName.Equals($"{groupName}_ro"))
    {
        return;
    }

    Directory.CreateDirectory(outputDirectory);

    using (var testListFile = new StreamWriter(testListFileName, append: false))
    {
        SortedSet<string> extraSharedFiles = new SortedSet<string>();

        foreach (var input in inputs)
        {
            ProcessInput(testListFile, groupName, input, extraSharedFiles);
        }

        foreach (string file in extraSharedFiles)
        {
            testListFile.WriteLine(file);
        }
    }
}

void ProcessInput(StreamWriter testListFile, string groupName, (string templateFileName, Dictionary<string, string> templateData) input, SortedSet<string> extraSharedFiles)
{
    var testName = $"{input.templateData["Method"]}.{input.templateData["RetBaseType"]}";

    var suffix = "";

    if (input.templateFileName == "SimpleUnOpConvTest.template" || input.templateFileName == "SimdScalarUnOpConvTest.template" )
    {
        testName = $"{input.templateData["Method"]}.{input.templateData["Op1VectorType"]}{input.templateData["Op1BaseType"]}";
        suffix = $"{input.templateData["Op1VectorType"]}{input.templateData["Op1BaseType"]}";
    }

    if (isImmTemplate(input.templateFileName))
    {
        testName += $".{input.templateData["Imm"]}";
        suffix += $"{input.templateData["Imm"]}";
    }

    if (input.templateFileName == "InsertLoadTest.template")
    {
        testName += ".Load";
        suffix += "Load";
    }
    else if (input.templateFileName == "ExtractStoreTest.template")
    {
        testName += ".Store";
        suffix += "Store";
    }
    else if (input.templateFileName == "ScalarTernOpTest.template")
    {
        testName += ".3Op";
        suffix += "3Op";
    }
    else if (input.templateFileName == "ScalarTernOpBinResTest.template")
    {
        testName += ".BinRes";
        suffix += "BinRes";
    }
    else if (input.templateFileName == "ScalarTernOpTupleBinRetTest.template")
    {
        testName += ".Tuple3Op";
        suffix += "Tuple3Op";
    }
    else if (input.templateFileName == "SimpleBinOpEmbRounding.template")
    {
        testName += ".EmbeddedRounding";
        testName += $".{input.templateData["RoundingMode"]}";
        suffix += "EmbeddedRounding";
    }

    var fileName = Path.Combine(outputDirectory, $"{testName}.cs");

    var matchingTemplate = Templates.Where((t) => t.outputTemplateName.Equals(input.templateFileName)).SingleOrDefault();
    var template = string.Empty;

    if (matchingTemplate.templateFileName is null)
    {
        string templateFileName = Path.Combine(templateDirectory, input.templateFileName);
        template = File.ReadAllText(templateFileName);
    }
    else
    {
        string templateFileName = Path.Combine(templateDirectory, matchingTemplate.templateFileName);
        template = File.ReadAllText(templateFileName);

        foreach (var kvp in matchingTemplate.templateData)
        {
            template = template.Replace($"{{{kvp.Key}}}", kvp.Value);
        }
    }

    foreach (var kvp in input.templateData)
    {
        template = template.Replace($"{{{kvp.Key}}}", kvp.Value);
    }
    template = template.Replace("namespace JIT.HardwareIntrinsics.X86", $"namespace JIT.HardwareIntrinsics.X86._{groupName}");

    foreach (var kvp in extraHelperFiles)
    {
        if (template.Contains(kvp.Key))
        {
            extraSharedFiles.Add(kvp.Value);
        }
    }

    testListFile.WriteLine(fileName);
    File.WriteAllText(fileName, template);
}
